@Component({
  selector: 'bm-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {}
<h1>Home</h1>

<a routerLink="/books" class="button red">
  Show book list
</a>

<h2>Search</h2>
<bm-search></bm-search>
